function App() {
  const expenses = [{
    date: new Date("2022-07-06"),
    title:'Insurance',
    amount:290
  }, {
    date:new Date("2022-03-06"),
    title:'Rent',
    amount:490
  }, {
    date: new Date("2022-05-05"),
    title:'Loan',
    amount:590
  }]
    ;
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      //<ExpenseItem title={expenseTitle} amount={expenseAmount} date={expenseDate}></ExpenseItem>

    </div>
  );
}

export default App;
